import React, { useState } from 'react';

const LoginPage = ({ onToggleSignUp }) => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleLogin = () => {
    // Perform login logic
    // For simplicity, let's consider it successful if username and password are not empty
    if (username.trim() !== '' && password.trim() !== '') {
      // Handle successful login, e.g., call an authentication function
      console.log('Login successful');
    } else {
      console.log('Invalid username or password');
    }
  };

  return (
    <div>
      <h2>Login Page</h2>
      <label htmlFor="username">Username:</label>
      <input type="text" id="username" value={username} onChange={(e) => setUsername(e.target.value)} />
      <br />
      <label htmlFor="password">Password:</label>
      <input type="password" id="password" value={password} onChange={(e) => setPassword(e.target.value)} />
      <br />
      <button onClick={handleLogin}>Login</button>
      <br />
      <p>
        Don't have an account? <span onClick={onToggleSignUp}>Sign up here</span>
      </p>
    </div>
  );
};

export default LoginPage;
